SearchKeywordIdeaServiceKeywordFrequency:
  type: string
  nullable: true
  enum:
  - ONCE_OR_MORE
  - TWICE_OR_MORE
  - THREE_TIMES_OR_MORE
  - UNKNOWN
  title: SearchKeywordIdeaServiceKeywordFrequency
  description: |
    <div lang="ja">SearchKeywordIdeaServiceKeywordFrequencyは、サーチキーワードの検索回数を表します。</div>
    <div lang="en">SearchKeywordIdeaServiceKeywordFrequency is an object for storing the search frequency information on Search Keyword.</div>
    <hr>
    <p>* <code>ONCE_OR_MORE</code> - <span lang="ja">1回以上です。</span><span lang="en">once or more</span></p>
    <p>* <code>TWICE_OR_MORE</code> - <span lang="ja">2回以上です。</span><span lang="en">twice or more</span></p>
    <p>* <code>THREE_TIMES_OR_MORE</code> - <span lang="ja">3回以上です。</span><span lang="en">three times or more</span></p>
    <p>* <code>UNKNOWN</code> - <span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></p>
